script: |
  super -f text -I q1146.spq | sort > q1146.out

inputs:
  - name: q1146.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col0 + - col2 NOT BETWEEN ( col1 / + col1 + + 8 * - col2 ) AND col0;
  - name: tab2

outputs:
  - name: q1146.out
    data: |
      46	51	23
      64	77	40
      75	67	58
